import Button from "react-bootstrap/Button";
// import './App.css';
import Badge from 'react-bootstrap/Badge';

function App() {
  return (
    <div className="App">
      <h1>Hello World!</h1>
      <h1>
        Example heading <Badge bg="secondary">New</Badge>
      </h1>

      <Button variant="primary">Primary</Button>{' '}
    </div>
  );
}

export default App;
